import base64
import mimetypes
import os
import string
import uuid
import zipfile
from datetime import datetime


class Epub3:
    __path2container_xml = "META-INF/container.xml"
    __path2package_opf = "EPUB/package.opf"
    __path2nav_xhtml = "EPUB/xhtml/nav.xhtml"
    __path2title_xhtml = "EPUB/xhtml/title.xhtml"
    __path2page_xhtml = "EPUB/xhtml/page{page}.xhtml"
    __path2style_css = "EPUB/style/style.css"
    __path2img = "EPUB/images/{image}"
    __path2img404_png = __path2img.format_map({"image": "404.png"})
    __path2mimetype = "mimetype"

    __relpath2page_xhtml = "xhtml/page{page}.xhtml"
    __relpath2img = "images/{image}"

    __content2img404_png = ""
    __content2style_css = "@charset \"UTF-8\";@namespace epub http://www.idpf.org/2007/ops;html,body,div,svg{margin:0;z-index:0;padding:0;border:none}img{height:98%;width:98%;margin:1%}"
    __content2page_template = "<?xml version=\"1.0\" encoding=\"UTF-8\"?><html xmlns=\"http://www.w3.org/1999/xhtml\" xmlns:epub=\"http://www.idpf.org/2007/ops\" xmlns:ssml=\"http://www.w3.org/2001/10/synthesis\" xml:lang=\"en\" lang=\"en\"><head><meta charset=\"utf-8\"/><title>${title}</title><link rel=\"stylesheet\" href=\"../style/style.css\" type=\"text/css\"/></head><body><div class=\"epub:type=bodymatter\"><svg version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" width=\"100%\" height=\"100%\" viewBox=\"0 0 ${width} ${height}\" preserveAspectRatio=\"xMidYMid meet\"><image width=\"${width}\" height=\"${height}\" xlink:href=\"../${src}\" /></svg></div></body></html>"
    __content2title_template = "<?xml version=\"1.0\" encoding=\"UTF-8\"?><html xmlns=\"http://www.w3.org/1999/xhtml\" xmlns:epub=\"http://www.idpf.org/2007/ops\" xmlns:ssml=\"http://www.w3.org/2001/10/synthesis\" xml:lang=\"en\" lang=\"en\"><head><meta charset=\"utf-8\"/><title>${title}</title></head><body><h1 style=\"margin:10% 1% auto\">{title}</hi></body></html>"
    # no expleziet navigation that rune the look and readablity on ebooks
    __content2nav_xhtml = "<?xml version=\"1.0\" encoding=\"utf-8\"?><!DOCTYPE html><html lang=\"en\" xmlns=\"http://www.w3.org/1999/xhtml\" xmlns:epub=\"http://www.idpf.org/2007/ops\"><head><title>${title}</title><meta charset=\"utf-8\"/></head><body><nav xmlns:epub=\"http://www.idpf.org/2007/ops\" epub:type=\"toc\"></nav></body></html>"
    __content2package_opf = "<?xml version=\"1.0\" encoding=\"UTF-8\"?><package version=\"3.0\" xmlns:dc=\"http://purl.org/dc/elements/1.1/\" xmlns:opf=\"http://www.idpf.org/2007/opf\" xmlns=\"http://www.idpf.org/2007/opf\" unique-identifier=\"Id\"><metadata><dc:identifier id=\"Id\">${id}</dc:identifier><dc:title>${title}</dc:title><dc:language>${lang}</dc:language><meta property=\"dcterms:modified\">${modified}</meta></metadata><manifest><item id=\"n1\" href=\"xhtml/nav.xhtml\" media-type=\"application/xhtml+xml\" properties=\"nav\"/><item id=\"c1\" href=\"style/style.css\" media-type=\"text/css\"/><item id=\"f1\" href=\"images/404.png\" media-type=\"image/png\"/>${manifest}</manifest><spine><itemref idref=\"n1\"/>${spine}</spine></package>"
    __content2container_xml = "<?xml version=\"1.0\" encoding=\"UTF-8\"?><container xmlns=\"urn:oasis:names:tc:opendocument:xmlns:container\" version=\"1.0\"><rootfiles><rootfile full-path=\"EPUB/package.opf\" media-type=\"application/oebps-package+xml\"/></rootfiles></container>"
    __content2mimetype = "application/epub+zip"

    def __init__(self, filename="manga.epub", title="manga", lang="en"):
        self.__created = datetime.utcnow()
        self.filename = filename
        self.__uuid = "urn:uuid:" + str(uuid.uuid5(uuid.NAMESPACE_URL, self.filename))
        self.title = title
        self.lang = lang
        self.__images = []
        self.__page_list = []
        self.__manifest = []
        self.__spine = []
        mimetypes.init()

    def create(self):
        print("start creating epub: {0}".format(self.title))
        with zipfile.ZipFile(self.filename, "w", zipfile.ZIP_DEFLATED) as epub:
            epub.writestr(self.__path2mimetype, self.__content2mimetype)
            epub.writestr(self.__path2container_xml, self.__content2container_xml)
            epub.writestr(self.__path2style_css, self.__content2style_css)
            epub.writestr(self.__path2nav_xhtml, self.__patch_nav_template())
            epub.writestr(self.__path2title_xhtml, self.__patch_title_template())
            epub.writestr(self.__path2package_opf, self.__patch_package_opf())
            epub.writestr(self.__path2img.format_map({"image": "404.png"}), base64.b64decode(self.__content2img404_png))
            for idx, img in enumerate(self.__images):
                epub.writestr(self.__path2page_xhtml.format_map({"page": idx + 1}),
                              self.__patch_page_template(img[2], img[3], img[4]))
                epub.write(img[0], img[1])
        print("stop creating epub: {0}".format(self.title))
        return self

    @staticmethod
    def __create_manifest_item(item_id, href, mediaType, fallback=None, properties=None):
        if properties is None:
            properties = []
        item = "<item id=\"" + item_id + "\" href=\"" + href + "\" media-type=\"" + mediaType + "\""
        if fallback is not None:
            item += " fallback=\"" + fallback + "\""
        if len(properties) > 0:
            item += " properties=\"" + " ".join(properties) + "\""
        return item + "/>"

    @staticmethod
    def __create_spine_itemref(idref, properties=None):
        if properties is None:
            properties = []
        itemref = "<itemref idref=\"" + idref + "\""
        if len(properties) > 0:
            itemref += " properties=\"" + " ".join(properties) + "\""
        return itemref + "/>"

    @staticmethod
    def __create_nav_page_list_item(name, path):
        return "<li><a href=\"../" + path + "\">" + name + "</a></li>"

    def __patch_package_opf(self):
        d = {
            "id": self.__uuid,
            "title": self.title,
            "lang": self.lang,
            "modified": self.__created.strftime("%Y-%m-%dT%H:%M:%SZ"),
            "manifest": self.__create_manifest_items(),
            "spine": self.__create_spine_itemrefs()
        }
        return string.Template(self.__content2package_opf).substitute(d)

    def __patch_page_template(self, src, height, width):
        return string. \
            Template(self.__content2page_template). \
            substitute(title=self.title, src=src, height=height, width=width)

    def __patch_nav_template(self):
        return string. \
            Template(self.__content2page_template). \
            substitute(title=self.title)

    def __patch_title_template(self):
        return string. \
            Template(self.__content2page_template). \
            substitute(title=self.title)

    def __create_manifest_items(self):
        result = ""
        for item in self.__manifest:
            result += self.__create_manifest_item(item[0], item[1], item[2], item[3], item[4])
        return result

    def __create_spine_itemrefs(self):
        result = ""
        for itemref in self.__spine:
            result += self.__create_spine_itemref(itemref[0], itemref[1])
        return result

    def __create_nav_page_list_items(self):
        result = ""
        for navitem in self.__page_list:
            result += self.__create_nav_page_list_item(navitem[0], navitem[1])
        return result

    def add_image(self, imagePath, height, width):
        path_img = self.__relpath2img.format_map({"image": os.path.basename(imagePath)})
        page = len(self.__page_list) + 1
        path_page = self.__relpath2page_xhtml.format_map({"page": page})
        idx = str(page)
        id_page = "p" + idx
        id_img = "i" + idx
        self.__manifest.append((id_img, path_img, mimetypes.guess_type(path_img)[0], "f1", []))
        self.__manifest.append((id_page, path_page, mimetypes.guess_type(path_page)[0], None, []))
        self.__spine.append((id_page, []))
        self.__page_list.append(("page " + str(page), path_page))
        self.__images.append(
            (imagePath, self.__path2img.format_map({"image": os.path.basename(imagePath)}), path_img, height, width)
        )
